import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => {
  return {
    dividerContainer: {
      position: 'relative',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      width: '100%',
      margin: '24px 0',
    },
    dividerBorder: {
      borderBottom: '1px solid rgba(1, 17, 54, 0.12)',
      width: '100%',
      position: 'absolute',
    },
    dividerContent: {
      padding: '0 10px 0 10px',
      margin: '0 20px 0 0px',
      zIndex: 2,
      background: theme.palette.background.paper,
    },
  };
});

export default useStyles;
